// LoginPage.js

import React from 'react';
import './LoginPage.css'; 

const LoginPage = () => {
    const handleGoogleLogin = () => {
        //  Google 
        console.log('Google login clicked');
      };
    
      const handleFacebookLogin = () => {
        // Facebook         console.log('Facebook login clicked');
      };
    
  return (
    <div className="login-container">
      <div className="left-section">
        <div className="logo-container">
    
          <img src="/images/Screenshot 2024-05-13 010213.png" alt="Logo" className="logo" />
          <h1 >PawsVeda</h1>
        </div>
        <div className="form-container">

          <div className="input-group">
            <label htmlFor="username">Enter Username</label>
            <input type="text" id="username" />
          </div>
          <div className="input-group">
            <label htmlFor="password">Enter Password</label>
            <input type="password" id="password" />
          </div>
          <div className="checkbox-group">
            <input type="checkbox" id="remember-me" />
            <label htmlFor="remember-me">Remember me</label>
            <a href="#">Forgot Password?</a>
          </div>
          <button className="login-btn">Login</button>
          <div className="social-login">
            
            <span>Login with:</span>
            <img src="" alt="Google" className="social-icon" />
            <img src="" alt="Facebook" className="social-icon" />
          </div>
          <hr />
          <div className="signup-link">
            <a href="#">Sign Up</a>
          </div>
        </div>
      </div>
      <div className="right-section">
    
        <img src="./images/pixlr-image-generator-22ff2b6c-c630-4d11-be63-440eb5a5e9f6 (1).png"alt="Dog" className="dog-image" />
      </div>
    </div>
  );
};

export default LoginPage;
